🆘Entrevista | “O elenco de crimes é imenso”, diz desembargador que defende a prisão de Moraes.

Sebastião Coelho 
❌ 
Tirano de Moraes

😨🥴🤐Festival de barbaridades da Ditadura da Toga.

🛑STF, o Politburo do Brasil❗

●Prática reiterada de crimes contra a ordem constitucional (inclusive tortura e ameaça);

●Moraes declarou guerra contra o Brasil;

●Série de ilegalidades cometidas por Moraes e decisões em flagrante delito;

●Abuso de autoridade;

●Prevaricação;

●Crime funcional ao inverter os papéis constitucionais;

●Usurpação ao tomar os lugares do delegado, promotor e juíz de primeira instância;

●STF descumpre a Constituição;

●STF rejeita o sistema acusatório, excluindo o Ministério Público;

●STF cercea as liberdades dos brasileiros;

●Defesa dos perseguidos sem acesso aos processos (como em ditaduras);

●STF desmoralizado;

●STF não presta contas a ninguém.

